import React from "react";
import PostList from "../component/postList";
import '../css/Main.css';
import "../css/mylist.css";

const Main = () => {
    //post리스트 받아서 map으로 
    return (
        <React.Fragment>
            <div className="postlist_wrap">
                <PostList />
            </div>
        </React.Fragment>
    )
}

export default Main;
